import React from "react";

export default function Sort() {
    return (
        <table className="sort-nav">
            <tr>
                <td className="genreCell">Genre</td>
                <td className="countryCell">Country</td>
                <td className="directorCell">Director</td>
                <td className="ratingCell">Rating</td>
            </tr>
        </table>
    )
}
